import React from 'react'

function Header() {
  return (
    <div className='w-full h-20 flex items-center border-b border-b-slate-800' >
        <div className="w-1/2 h-full flex items-center">
            <h1 className='text-3xl font-bold left' >Inspire.</h1>
        </div>
        <div className="w-1/2 h-full"></div>
    </div>
  )
}

export default Header
